class Blog extends Component {
render() {
   return (
    <div>
<Container>

   <Grid container columns={3}>

   <Grid.Row>
    <Grid.Column width={3}>
      OK
    </Grid.Column>

    <Grid.Column width={3}>
      I see
    </Grid.Column>

    <Grid.Column width={10}>
      GoodBye
    </Grid.Column>
    </Grid.Row> 

  </Grid>

 </Container>

  </div>
